import { Paper, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

function HomePage() {
  return (
    <Box textAlign="center">
      <Paper sx={{ width: 200 }}>
        <Typography>Hii</Typography>
      </Paper>
    </Box>
  );
}

export default HomePage;
